                        max_depth = max(max_depth, depth)
                    break
            return max_depth - 1

        result = [0] * (n - 1)
        for mask in range(1, 1 << n):
            diameter = get_diameter(mask)
            if diameter > 0:
                result[diameter - 1] += 1
        return result

